import React,{useEffect} from 'react'

const Api = () => {

    useEffect(() => {
        const url = 'https://jsonplaceholder.typicode.com/posts'
        fetch(url).then(resp=>resp.json())
        .then(resp=>console.log(resp))
    }, [])

 
    return (
        <>
        <h1>This is react api call</h1>
          
        </>
    )
}

export default Api
